UserConnection = UserConnection.AppConnection.SystemUserConnection;
var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "InfNextActivities");
esq.AddColumn("Activity");
esq.AddColumn("NextActivity");
string idColumnName = esq.AddColumn(esq.RootSchema.GetPrimaryColumnName()).Name;


	var esqFirstFilter = esq.CreateFilterWithParameters(
															FilterComparisonType.Equal,
															"Activity",
															CurrentActivityId
														);
	esq.Filters.LogicalOperation = LogicalOperationStrict.And;
	esq.Filters.Add(esqFirstFilter);
	
	var Activityesq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "Activity");
	
	Activityesq.AddColumn("NumberOfPredActivity");
	var idActivityName = Activityesq.AddColumn(esq.RootSchema.GetPrimaryColumnName());
	
	var ActivityesqFirstFilter = Activityesq.CreateFilterWithParameters(
															FilterComparisonType.Equal,
															"Change",
															CurrentChangeId
														);
	var ActivityesqSecondFilter = Activityesq.CreateFilterWithParameters(
															FilterComparisonType.Equal,
															"StageNumber",
															Number
														);
	Activityesq.Filters.Add(ActivityesqFirstFilter);
	Activityesq.Filters.Add(ActivityesqSecondFilter);
	
	var activities = Activityesq.GetEntityCollection(UserConnection);	
	int k = 0;
	var items = esq.GetEntityCollection(UserConnection);
	//kmResult = "Дошло до if (items.Count > 0)";
	if (items.Count > 0) {
			//kmResult = "Дошло до foreach(var item in items)";
		foreach(var item in items) {
			var NextActivityId = item.GetTypedColumnValue<Guid>("NextActivityId");
				//kmResult = "Дошло до foreach(var activity in activities)";
				foreach(var activity in activities) {
					var activityId = activity.GetTypedColumnValue<Guid>(idActivityName.Name);
						k++;
						//kmResult = "Дошло до if (activityId==NextActivityId) Число повторений: " + Convert.ToString(k) + " ID1: " + Convert.ToString(activityId) + " ID2: " + Convert.ToString(NextActivityId);
					if (NextActivityId==NextActivityId) {
							//kmResult = "Дошло до var CountPrevActivities = ";
						var CountPrevActivities = activity.GetTypedColumnValue<int>("NumberOfPredActivity") + 1;
						var update = new Update(UserConnection, "Activity")
								.Set("NumberOfPredActivity", Column.Parameter(CountPrevActivities)) as Update;
							update.Execute();
							
						var processSchemaManager = (ProcessSchemaManager)UserConnection.GetSchemaManager(@"ProcessSchemaManager");
						var processSchema = processSchemaManager.GetInstanceByName(@"AddPermissionsForActivitySubProcess");
						var process = processSchema.CreateProcess(UserConnection);
						process.SetPropertyValue(@"ActivityId", activityId);
						process.SetPropertyValue(@"Count", CountPrevActivities);
						process.Execute(UserConnection);
					}
				}


	}
}
return true;
